@EU_Commission There are two better options:

1) don’t cut welfare 
2) fund the poor, not the charities

Contacts between EU and UK teams are continuing. 
@JunckerEU spoke to @BorisJohnson this morning.
Every hour and minute counts before the #EUCO.

@EU_Commission You can fund all the charities you want. 
However, we Europeans want their accounting made public, so we can make sure this isn't another scam with our money. 
Where on your web can we find this information?

@EU_Commission @Avramopoulos @EUHomeAffairs @NatashaBertaud So what does this mean?
Open border policy?
Tell us about how you are preserving Europe and it’s people.

@EU_Commission Yes it is.
It is a sadder day when the people are silenced and politicians take their liberty.
Macedonia.
